// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0 <0.9.0;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
import "./TokenFarm.sol";
import "./CreateNFT.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";


contract CreateNFTNode is ERC721Enumerable, Ownable {
    string public baseURI;
    uint256 public counter = 1;
    bool public paused = false;
    string public contractUri;
    uint256[] public rewardRates;
    address[] public addresses;
    uint256[] public fees;
    uint256[] public priceNodes;
    uint256 public mintRate;
    bool locked;
    uint256[] tierCounter;
    uint256[] tierMax;

    struct Node {
        uint256 rewardTimestamp;
        uint256 feeTimestamp;
        uint256 tierNumber;
        uint256 rewardSum;
        uint256 rewardRate;
        bool monthlyFeePaid;
        bool firstRound;
        uint256 calcPre;
    }

    struct Nft {
        uint256 lastUpdate;
        bool firstMintOver;
    }

    mapping(address => uint256[]) public tokenIds;
    mapping(uint256 => Node) public nodeToken;
    mapping(address => mapping(uint256 => uint256)) public tokensReceived;
    mapping(address => mapping(uint256 => Nft)) public nftMapping;

    constructor (string memory _name,
        string memory _symbol,
        string memory _initBaseURI, string memory _initContractURI, uint256[] memory _initRewardRates, address[] memory _initAddresses, uint256[] memory dollarFees, uint256[] memory _initPriceNodes, uint256 _initMintRate, uint256[] memory _initTierMax) public ERC721 (_name, _symbol){
        setBaseURI(_initBaseURI);
        setContractURI(_initContractURI);
        setRewardRates(_initRewardRates);
        setAddresses(_initAddresses);
        setFees(dollarFees);
        setPriceNodes(_initPriceNodes);
        setMintRate(_initMintRate);
        setTierMax(_initTierMax);
        locked = true;
        tierCounter = new uint256[](3);
    }

    //set the locked flag for transfers
    function setLocked(bool _locked) public onlyOwner
    {
        locked = _locked;
    }


    //override beforeTokenTransfer to prevent node transfers except the mint
    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual override {
        super._beforeTokenTransfer(from, to, tokenId);
        if (locked == true)
        {
            require(from == address(0), "Node NFT Transfers currently not allowed!");
        }

    }


    //set the rate for the node mints
    function setMintRate(uint256 _newMintRate) public onlyOwner
    {
        mintRate = _newMintRate;
    }

    function setTierMax(uint256[] memory _newTierMax) public onlyOwner
    {
        tierMax = _newTierMax;
    }


    //set the buy prices for the nodes in FACED token
    function setPriceNodes(uint256[] memory _newPriceNodes) public onlyOwner
    {
        priceNodes = _newPriceNodes;
    }

    //get information about a specific node
    function getNodeToken(uint256 tokenId) public view returns (uint256, uint256, uint256, bool, uint256)
    {
        return (nodeToken[tokenId].rewardTimestamp, nodeToken[tokenId].feeTimestamp, nodeToken[tokenId].tierNumber, nodeToken[tokenId].monthlyFeePaid, nodeToken[tokenId].rewardRate);

    }

    //set the monthly fees for claiming rewards
    function setFees(uint256[] memory _fees) public onlyOwner
    {
        fees = _fees;
    }


    //get price()
    //TODO: test
    function getPrice() public view returns (uint256){

        (,int256 answer,,,) = AggregatorV3Interface(addresses[2]).latestRoundData();
        return uint256(answer * 10000000000);
    }

    // 1000000000
    //TODO: test
    function getConversionRate(uint256 ftmAmount) public view returns (uint256){
        return (getPrice() * ftmAmount) / 1000000000000000000;
    }


    //get the contract URI
    function contractURI() public view returns (string memory) {
        return contractUri;
    }


    //set the different token addresses (nft, token, farm, price feed)
    function setAddresses(address[] memory _addresses) public onlyOwner
    {
        addresses = _addresses;
    }


    // internal
    function _baseURI() internal view virtual override returns (string memory) {
        return baseURI;
    }


    //set base uri for metadata
    function setBaseURI(string memory _newBaseURI) public onlyOwner {
        baseURI = _newBaseURI;
    }


    //set the different reward rates for the different tiers
    function setRewardRates(uint256[] memory _newRewardRates) public onlyOwner {
        rewardRates = _newRewardRates;
    }

    //get the current timestamp
    function getTime() public virtual view returns (uint256)
    {
        return block.timestamp;
    }


    //pause the mint
    function pause(bool _state) public onlyOwner {
        paused = _state;
    }


    //mint nfts for giveaways by the owner
    function mintForGiveaways(uint256 number) public onlyOwner {
        for (uint256 i = 0; i < number; i++) {
            _safeMint(msg.sender, counter);
            counter = counter + 1;}
    }

    //check the number of purchased nodes, price goes up after specific steps
    function checkStepCounter() private
    {
        if (counter % 10000 == 0)
        {
            priceNodes[0] = priceNodes[0] + 1;
        }
        else if (counter % 5000 == 0)
        {

            priceNodes[1] = priceNodes[1] + 3;

        }

        else if (counter % 3000 == 0)
        {
            priceNodes[2] = priceNodes[2] + 11;
        }
    }

    //mint nodes (only possible when having staked nft)
    function mint(uint256 tokenId) public virtual payable {
        require(!paused, "Mint paused");
        uint256 tierNumber;
        uint256 numberOfNodes;
        //TODO: checkTime
        //check if there is staked token with this id and sender
        (bool doesExist,,) = TokenFarm(addresses[1]).getStakedToken(msg.sender, tokenId);
        if (doesExist == true) {
            //first node can be minted without waiting one month
            if (nftMapping[msg.sender][tokenId].firstMintOver == false && getNumberOfNodes(msg.sender, tokenId) < 1)
            {
                numberOfNodes = 1;
            }
            //else the number will be calculated, needs to be more than 1
            else {
                numberOfNodes = getNumberOfNodes(msg.sender, tokenId);
                require(numberOfNodes > 0, "You can't mint yet!");
            }
            //nfts with id <= 9886 can only mint tier one
            if (tokenId <= 9886)
            {
                tierNumber = 1;
            }
            //only legendary get tier 3
            else
            {
                tierNumber = 3;
            }

            require(tierCounter[tierNumber - 1] + numberOfNodes <= tierMax[tierNumber - 1], "Sold out!");

            for (uint256 i = 0;
                i < numberOfNodes;
                i++)
            {
                //mint nodes and safe in mapping
                _safeMint(msg.sender, counter);
                //TODO: check
                checkStepCounter();
                nodeToken[counter] = Node(getTime(), getTime(), tierNumber, 0, rewardRates[tierNumber - 1], true, false, 0);
                //TODO: check
                tierCounter[tierNumber - 1] += 1;
                counter = counter + 1;
            }
            //mapping for knowing when time for next mint
            nftMapping[msg.sender][tokenId] = Nft(getTime(), true);
        }
        else
        {
            //if there is no staked nft anymore the mapping can be deleted and the function will revert
            delete nftMapping[msg.sender][tokenId];
            require(doesExist == true, "You don't have a staked NFT!");
        }
    }

    //buy node with specific tier
    function buy(uint256 tier) public virtual payable
    {require(!paused, "Mint paused!");
        require((tier > 0) && (tier < 4), "There is only tier 1-3!");
        require(tierCounter[tier - 1] <= tierMax[tier - 1], "Sold out!");
        checkStepCounter();
        require(ERC20(addresses[0]).balanceOf(msg.sender) >= priceNodes[tier - 1], "Not enough tokens to buy!");
        ERC20(addresses[0]).transferFrom(msg.sender, owner(), priceNodes[tier - 1]);
        _safeMint(msg.sender, counter);
        nodeToken[counter] = Node(getTime(), getTime(), tier, 0, rewardRates[tier - 1], true, false, 0);
        tierCounter[tier - 1] += 1;
        counter = counter + 1;
    }

    //TODO: pay Problems
    //pay the monthly fee for getting rewards (only for tier3 nft holder or only node holder)
    function payMonthlyFee(uint256 _tokenId) public virtual payable
    {
        require(ownerOf(_tokenId) == msg.sender, "Needs to be owner of Node");
        if (CreateNFT(addresses[3]).balanceOf(msg.sender) > 0)
        {
            require(nodeToken[_tokenId].tierNumber == 3, "You don't need to pay");
        }
        require(getConversionRate(msg.value) >= fees[nodeToken[_tokenId].tierNumber - 1] * 10 ** 18, "You don't have enough money!");
        nodeToken[_tokenId].monthlyFeePaid = true;
        nodeToken[_tokenId].feeTimestamp = getTime();
    }
    //TODO:do it
    //check if the month is over for the fee to pay
    function checkIfMonthOver(uint256 _tokenId, address sender) private
    {
        if (calcTimeElapsedFee(_tokenId) > mintRate) {
            if (CreateNFT(addresses[3]).balanceOf(msg.sender) == 0)
            {
                nodeToken[_tokenId].monthlyFeePaid = false;
            }
            else
            {
                if (nodeToken[_tokenId].tierNumber == 3)
                {
                    nodeToken[_tokenId].monthlyFeePaid = false;
                }
            }
        }}


    //metadata URI for nfts
    function tokenURI(uint256 tokenId)
    public
    view
    virtual
    override
    returns (string memory)
    {
        require(
            _exists(tokenId),
            "ERC721Metadata: URI query for nonexistent token"
        );
        //TODO: idea
        if (nodeToken[tokenId].tierNumber == 1)
        {
            return string(abi.encodePacked(
                    _baseURI(), "/",
                    Strings.toString(1)
                ));
        }

        else if (nodeToken[tokenId].tierNumber == 2)
        {
            return string(abi.encodePacked(
                    _baseURI(), "/",
                    Strings.toString(2)
                ));

        }
        else {
            string memory currentBaseURI = _baseURI();
            return string(abi.encodePacked(
                    currentBaseURI, "/",
                    Strings.toString(3)
                ));}
    }

    //return nft ids of one owner
    function walletOfOwner(address _owner)
    public
    view
    returns (uint256[] memory)
    {
        uint256 ownerTokenCount = balanceOf(_owner);
        uint256[] memory tokenIdes = new uint256[](ownerTokenCount);
        for (uint256 i; i < ownerTokenCount; i++) {
            tokenIdes[i] = tokenOfOwnerByIndex(_owner, i);
        }
        return tokenIdes;
    }

    // set contract uri
    function setContractURI(string memory _contractURI) public onlyOwner {
        contractUri = _contractURI;
    }

    //withdraw the collected eth from mint
    function withdraw() payable onlyOwner public {
        payable(msg.sender).transfer(address(this).balance);
    }

    // get the claim fee for the rewards
    function getClaimFee(uint256 _tokenId) public view returns (uint256)
    {
        if (calcTimeElapsedReward(_tokenId) < 518400)
        {
            return 88;

        }
        else if ((calcTimeElapsedReward(_tokenId) > 518400) && (calcTimeElapsedReward(_tokenId) < 1123200))
        {
            return 94;
        }
        else {
            return 100;
        }

    }

    //claim reward token
    function claimRewards(uint256 nodeTokenId) public
    {
        //TODO: paid the fee
        //TOD0: check if msg.sender owns this id
        require(ownerOf(nodeTokenId) == msg.sender, "Needs to be owner of the node");
        checkIfMonthOver(nodeTokenId, msg.sender);
        require(nodeToken[nodeTokenId].monthlyFeePaid == true, "You need to pay the fee first!");
        nodeToken[nodeTokenId].rewardRate = rewardRates[nodeToken[nodeTokenId].tierNumber - 1];
        uint256 wholeReward = calcTimeElapsedReward(nodeTokenId) * nodeToken[nodeTokenId].rewardRate * getClaimFee(nodeTokenId);
        nodeToken[nodeTokenId].rewardTimestamp = getTime();
        require(wholeReward > 0, "Reward needs to be greater than 0!");
        ERC20(addresses[0]).transferFrom(owner(), msg.sender, wholeReward / 100);
        nodeToken[nodeTokenId].rewardSum += wholeReward;
        uint256 calc = nodeToken[nodeTokenId].rewardSum / priceNodes[nodeToken[nodeTokenId].tierNumber - 1];
        if ((nodeToken[nodeTokenId].calcPre < calc) && (calc <= 1))
        {
            nodeToken[nodeTokenId].rewardRate = 7 * nodeToken[nodeTokenId].rewardRate / 10;
            nodeToken[nodeTokenId].calcPre = calc;
        }
        else if (nodeToken[nodeTokenId].calcPre < calc)
        {
            nodeToken[nodeTokenId].rewardRate = 95 * nodeToken[nodeTokenId].rewardRate / 100;
            nodeToken[nodeTokenId].calcPre = calc;
        }
    }

    //get the time elapsed since last reward
    function calcTimeElapsedReward(uint256 _tokenId) public view returns (uint256)
    {
        return getTime() - nodeToken[_tokenId].rewardTimestamp;
    }

    // get time elapsed since last fee
    function calcTimeElapsedFee(uint256 _tokenId) public view returns (uint256)
    {
        return getTime() - nodeToken[_tokenId].feeTimestamp;
    }

    //calculates the time that has elapsed since the last node mint
    function calcTimeElapsedForNFTMint(address _staker, uint256 _tokenId) public view returns (uint256)
    {
        uint256 elapsedTime;
        //get the start timestamp and the duration in months of the staked nft
        (, uint256 startTimestamp, uint256 nrOfMonths) = TokenFarm(addresses[1]).getStakedToken(msg.sender, _tokenId);
        //if first time call
        if ((nftMapping[_staker][_tokenId].lastUpdate == 0) || (nftMapping[_staker][_tokenId].lastUpdate < startTimestamp))
        {
            //maximum elapsed time can be the staked time
            if (getTime() > (startTimestamp + nrOfMonths * 2628000))
            {
                elapsedTime = (startTimestamp + nrOfMonths * 2628000) - startTimestamp;
            }
            //else elapsed time since start of staking
            else {
                elapsedTime = getTime() - startTimestamp;
            }
        }
        //TODO: revert
        //TODO: check what if he stakes after unstaking again, and then trying to get it again
        //if trying to mint nft after staking no more rewards possible
        else if (nftMapping[_staker][_tokenId].lastUpdate >= startTimestamp + nrOfMonths * 2628000)
        {
            elapsedTime = 0;
        }

        else {
            if (getTime() > (startTimestamp + nrOfMonths * 2628000))
            {
                elapsedTime = (startTimestamp + nrOfMonths * 2628000) - nftMapping[_staker][_tokenId].lastUpdate;
            }
            else {
                elapsedTime = getTime() - nftMapping[_staker][_tokenId].lastUpdate;
            }
        }
        return elapsedTime;
    }

    //checks if the staker can mint another node
    function checkIfTimeForMint(address _staker, uint256 _tokenId) public view returns (bool)
    {
        if (calcTimeElapsedForNFTMint(_staker, _tokenId) >= mintRate)
        {
            return true;
        }
        else
        {
            return false;
        }
    }

    //get the number of nodes that can be minted by staker
    function getNumberOfNodes(address staker, uint256 tokenId) public view returns (uint256)
    {
        if (checkIfTimeForMint(staker, tokenId) == true)
        {
            return calcTimeElapsedForNFTMint(staker, tokenId) / mintRate;
        }
        else {
            return 0;
        }
    }}
